import React, {Component} from 'react';
import MainTemplate from '../layouts/Main';

class IndexPage extends Component {
    render() {
        return (
            <MainTemplate>
                <h1>It works!</h1>

                <style jsx>{`
                    h1 {
                        color: blue;
                    }
                `}</style>

            </MainTemplate>
        );
    }
}

export default IndexPage;
